import "./navbar.css"
import React from "react";

const Navbar = () => {
    return (
        <div className="navbar">
            <ul className="navbar-logoList">
            <li className="navbar-logoListItem-one"><p>BLACK LIT</p></li>
            <li className="navbar-logoListItem-two"><p>(erotica)</p></li>
            <li className="logo">
            <img src={require('../images/Logo Official.png')} alt=''></img>
            </li>
            </ul>
        </div>
    )
};

export default Navbar;
